    componentDidMount() {
        fetch("https://maps.googleapis.com/maps/api/place/findplacefromtext/json?input=Museum%20of%20Contemporary%20Art%20Australia&inputtype=textquery&fields=photos,formatted_address,name,rating,opening_hours,geometry&key=AIzaSyC1ucluPOje2LzYoF5hnN2M9PvnKSYurQg/*")
            .then(response => response.json())
            .then(results => console.log(results))
    }
    render(){
        return (
            <div>
